import React, { useState, useEffect } from "react";
import { ReactTitle } from "react-meta-tags";
import { Navbar } from "../../componentes/Navbar";
import { Header } from "../../componentes/Header";
import { Footer } from "../../componentes/Footer";
import { Barra } from "../../componentes/BarraMitad";
import "bootstrap/dist/css/bootstrap.css";
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrash, faEdit } from '@fortawesome/free-solid-svg-icons';
library.add(faTrash, faEdit);


export const UserMPHedit = () => {

    const [userName, setUserName] = useState("");

    useEffect(() => {
        const savedUserData = localStorage.getItem("userData");

        if (savedUserData) {
            const userDataObject = JSON.parse(savedUserData);
            const { nombre } = userDataObject;

            setUserName(nombre);
        }
    }, []);

    return (
        <div className="loginpage">
            <ReactTitle title="GestiÃ³n de usuarios" />
            <Navbar />
            <Header />
            <Barra titulo={`Bienvenid@ ${userName || "admin"},`} />
            <div className="full-wrap">

            <div className="admin-wrapper">
      <div className="section-wrapper">
        <div className="obj-wrapper">
          <div className="user-obj">
            <img src="https://www.mundopsicologos.com/site/article/60606/50895/las-10-cualidades-de-una-persona-mas-valoradas-0_ai1.jpg" alt="" />
            <div className="info">
              <input type="text" className="input-user-edit" placeholder="Nombre" />
              <input type="number" className="input-user-edit" placeholder="Celular" />
              <input type="email" className="input-user-edit" placeholder="Correo" />
              <input type="text" className="input-user-edit" placeholder="Cargo" />
              <span id="titulo_info_espacios">Rol:</span>
              <div className="form-check">
                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1" />
                <label className="form-check-label" htmlFor="flexRadioDefault1">
                  Administrador
                </label>
              </div>
              <div className="form-check">
                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault2" />
                <label className="form-check-label" htmlFor="flexRadioDefault2">
                  Empleado
                </label>
              </div>
              <div className="form-check">
                <input className="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault3" defaultChecked />
                <label className="form-check-label" htmlFor="flexRadioDefault3">
                  Cliente
                </label>
              </div>
            </div>
          </div>
          <div className="user-obj-footer">
            <button className="borrar" style={{ fontSize: '24px', color: 'red' }}>
              <i className="fa fa-trash-o"></i>
            </button>
            <a href="userManagementPH.html">
              <button className="editar" style={{ fontSize: '24px', color: 'green' }}>
                <i className="fa fa-edit"></i>
              </button>
            </a>
          </div>
        </div>
      </div>
    </div>

                
            </div>
            <Footer />
            </div>
            );
};
